package ru.jmentor.SpringBootExample.model;public class UserForm {    private Long userId;    private String userName;    private String userPassword;    private String userEmail;    private String userRole;    public Long getUserId() {        return userId;    }    public void setUserId(Long userId) {        this.userId = userId;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getUserPassword() {        return userPassword;    }    public void setUserPassword(String userPassword) {        this.userPassword = userPassword;    }    public String getUserEmail() {        return userEmail;    }    public void setUserEmail(String userEmail) {        this.userEmail = userEmail;    }    public String getUserRole() {        return userRole;    }    public void setUserRole(String userRole) {        this.userRole = userRole;    }}